import React, {Component} from 'react'
import PropTypes from 'prop-types'

class TapasList extends Component {

  static propTypes = {
    tapas: PropTypes.array,
  };

  constructor(props){
    super(props)
  }

  render() {

    const {tapas} = this.props;

    return (
      <div>
        <ol>
          { // Builing a list
            (tapas.length && (tapas.map( tapa => (
              <li key={tapa.venue.id} className='card'>
                <div className='card-body'>
                  <img src={`https://via.placeholder.com/300`} alt="Card image cap"/>
                  <div className="card-body">
                    <h5 className="card-title">{tapa.venue.name}</h5>
                    <p className="card-text">Address: {tapa.venue.location.address}</p>
                  </div>
                </div>
              </li>
            ))))
        }
        </ol>
      </div>
    )
  }
}

export default TapasList;
